static int switch_socket_transport(int fd)
{
    char service[64];
    char tmp[5];
    int len;
	snprintf(service, sizeof(service), "host:transport-any");

    len = strlen(service);
    snprintf(tmp, sizeof(tmp), "%04x", len);

    if(writex(fd, tmp, 4) || writex(fd, service, len)) {
        close(fd);
        return -1;
    }
    if(adb_status(fd)) {
        close(fd);
        return -1;
    }
    return 0;
}

int adb_status(int fd)
{
    unsigned char buf[5];
    unsigned len;

    if(readx(fd, buf, 4)) {
        return -1;
    }

    if(!memcmp(buf, "OKAY", 4)) {
        return 0;
    }

    if(memcmp(buf, "FAIL", 4)) {
        return -1;
    }

    if(readx(fd, buf, 4)) {
        return -1;
    }
    buf[4] = 0;
    len = strtoul((char*)buf, 0, 16);
    if(len > 255) len = 255;
    if(readx(fd, __adb_error, len)) {
        return -1;
    }
    __adb_error[len] = 0;
    return -1;
}

