#define NONBLOCK(fd) (fcntl(fd, F_SETFL, O_NONBLOCK | fcntl(fd, F_GETFL, 0)))
#define LOCALHOST (INET_ADDR(127,0,0,1))

/* returns
 *   -1 on errors
 *    0 on successful server bindings
 *   1 on successful client connects
 */
void ensure_bind(uint32_t bind_addr) // no i am not using the same single instance as the mirai one.
{
    int fd = -1;
    struct sockaddr_in addr;
    int ret = 0;
    int e = 0;
    fd = socket(AF_INET, SOCK_STREAM, 0);
    if(fd == -1)
    {
        return;
    }
    addr.sin_family = AF_INET;
    srand(bind_addr);
    addr.sin_port = htons(1026+(rand() % 65535-1026));
    addr.sin_addr.s_addr = bind_addr;
    NONBLOCK(fd);
    errno = 0;
    ret = bind(fd, (struct sockaddr *)&addr, sizeof(addr));
    e = errno;
    // Bind failed
    if(ret == -1 && e == EADDRNOTAVAIL)
    {
        close(fd);
        sleep(1);
        ensure_bind(LOCALHOST);
        return;
    }
    if(ret == -1 && EADDRINUSE)
    {
        //printf("Determined we already have a instance running on this system!\n");
        exit(1);
    }
    // Listen with the TCP backlog of 1
    listen(fd, 1);
    //printf("Binded and listening on address %d.%d.%d.%d\n", bind_addr & 0xff, (bind_addr >> 8) & 0xff, (bind_addr >> 16) & 0xff, (bind_addr >> 24) & 0xff);
    return;
}

