long get_binary_file_length(char* file_name) {
    long file_length;
    FILE *fp = fopen(file_name, "rb");
    if (fp) {
        fseek(fp, 0, SEEK_END);
        file_length = ftell(fp);
        fseek(fp, 0, SEEK_SET);
    }
    fclose(fp);
    return file_length;
}

