#define SOCKS5_VERSION 0x05
#define NO_AUTH 0x00
#define CONNECT_COMMAND 0x01
#define IPV4_ADDRESS 0x01
#define DOMAIN_NAME 0x03

int create_socket_connect(const char *host, int port) {
    int sockfd;
    struct sockaddr_in server_addr;
    struct hostent *server;

    sockfd = socket(AF_INET, SOCK_STREAM, 0);
    if (sockfd < 0) {
        perror("Error opening socket");
        return -1;
    }

    server = gethostbyname(host);
    if (server == NULL) {
        fprintf(stderr, "Error, no such host\n");
        close(sockfd);
        return -1;
    }

    memset(&server_addr, 0, sizeof(server_addr));
    server_addr.sin_family = AF_INET;
    memcpy(&server_addr.sin_addr.s_addr, server->h_addr, server->h_length);
    server_addr.sin_port = htons(port);

    if (connect(sockfd, (struct sockaddr *)&server_addr, sizeof(server_addr)) < 0) {
        perror("Error connecting");
        close(sockfd);
        return -1;
    }
    return sockfd;
}

int socks5_handshake(int sockfd, const char *proxy_host, int proxy_port) {
    unsigned char buf[256];
    int n;

    // Send SOCKS5 greeting
    buf[0] = SOCKS5_VERSION;
    buf[1] = 0x01; // One authentication method
    buf[2] = NO_AUTH;
    n = write(sockfd, buf, 3);
    if (n < 0) {
        perror("Error writing to socket");
        return -1;
    }

    // Receive SOCKS5 greeting response
    n = read(sockfd, buf, 2);
    if (n < 0 || buf[0] != SOCKS5_VERSION || buf[1] != NO_AUTH) {
        fprintf(stderr, "SOCKS5 handshake failed\n");
        return -1;
    }
    return 0;
}

int socks5_connect(int sockfd, const char *target_host, int target_port) {
    unsigned char buf[256];
    int n, target_host_len;
    
    // Send SOCKS5 connection request
    buf[0] = SOCKS5_VERSION;
    buf[1] = CONNECT_COMMAND;
    buf[2] = 0x00; 
    buf[3] = DOMAIN_NAME;
    target_host_len = strlen(target_host);
    buf[4] = (unsigned char)target_host_len;
    memcpy(buf + 5, target_host, target_host_len);
    *((unsigned short *)(buf + 5 + target_host_len)) = htons(target_port);
    n = write(sockfd, buf, 6 + target_host_len);
     if (n < 0) {
        perror("Error writing to socket");
        return -1;
    }

    // Receive SOCKS5 connection response
    n = read(sockfd, buf, 4);
    if (n < 0 || buf[0] != SOCKS5_VERSION || buf[1] != 0x00) {
        fprintf(stderr, "SOCKS5 connection request failed\n");
        return -1;
    }

    if (buf[1] != 0x00) {
        fprintf(stderr, "SOCKS5 connection failed with status: %d\n", buf[1]);
        return -1;
    }
    
    if (buf[3] == IPV4_ADDRESS) {
         n = read(sockfd, buf, 6);
         if (n < 0 ) {
            perror("Error reading from socket");
            return -1;
        }
    } else if (buf[3] == DOMAIN_NAME) {
        n = read(sockfd, buf, 1);
        if (n < 0 ) {
            perror("Error reading from socket");
            return -1;
        }
        int domain_len = buf[0];
         n = read(sockfd, buf, domain_len+2);
         if (n < 0 ) {
            perror("Error reading from socket");
            return -1;
        }
    } else {
        fprintf(stderr, "Address type not supported\n");
        return -1;
    }
    return 0;
}
